  {
    id: 2,
    title: 'What I am working on',
    content: 'How to be a better developer',},
  {
    id: 3,
    title: 'But I like to write',
    content: 'So here is something to combine my passions',
  },
  {
    id: 4,
    title: 'Stick around',
    content: 'Feel Free to look around',
